import React, { Component } from 'react';
import { Input, FormText } from 'reactstrap';

export default class SupportTypeOptions extends Component {
   state = {
      supportTypeArr: ['Dedicated', 'Shared']
   };

   renderOptions() {
      return this.state.supportTypeArr.map((option, key) => {
         return (
            <option key={key} value={option}>
               {option}
            </option>
         );
      });
   }

   render() {
      return (
         <div>
            <Input
               type='select'
               name={this.props.name}
               id={this.props.name}
               ref={this.props.name}
               size='sm'
               onChange={this.props.onChange}
               className={this.props.className}
               disabled={this.props.disabled}
            >
               <option selected disabled hidden>
                  Please Select Support Type
               </option>
               {this.renderOptions()}
            </Input>
            <FormText>Please provide support type</FormText>
         </div>
      );
   }
}
